import { Link } from "react-router-dom";

const projects = [
  {
    title: "Laundry-Service",
    description: "A full-stack laundry service platform with order tracking and admin panel.",
    tech: "React, Node.js, MongoDB, Express",
  },
  {
    title: "Live Location Tracker",
    description: "Real-time map with Google Maps API and WebSocket updates.",
    tech: "React, Express, MongoDB, Firebase",
  },
  {
    title: "Text To Speech Converter",
    description: "Convert paragraph to audio using React.",
    tech: "React, JavaScript, HTML, CSS",
  
  },
];

const Projects = () => (
  <div className="p-6">
    <h2 className="text-3xl font-semibold mb-4">Projects</h2>
    {projects.map((p, index) => (
      <div key={index} className="mb-4 border-b pb-4">
        <h3 className="text-xl font-bold">{p.title}</h3>
        <p>{p.description}</p>
        <p className="text-sm text-gray-500">Tech Stack: {p.tech}</p>
      </div>
    ))}
  </div>
);
export default Projects;
